INSERT

INTO XXFND_LOOKUP_VALUES

  (

    LOOKUP_VALUE_ID,

    LOOKUP_TYPE_ID,

    LOOKUP_VALUE_NAME,

    LOOKUP_VALUE_NAME_DISP,

    LOOKUP_VALUE_NAME_DISP_TL,

    ACCESS_LEVEL,

    LOOKUP_ADDL_VALUE,

    ACTIVE_YN,

    CREATED_BY,

    CREATION_DATE,

    LAST_UPDATED_BY,

    LAST_UPDATE_DATE,

    LAST_UPDATE_LOGIN,

    PARENT_VALUE_ID

  )

  VALUES

  (

    xxfnd_lookup_value_id_s.nextval,

    (SELECT lookup_type_id

    FROM xxfnd_lookup_types

    WHERE lookup_type_name='CANCELLATION_TYPE'

    ),

    'UT',

    'Unit Transfer',

    NULL,

    'U',

    NULL,

    'Y',

    'anonymous',

    sysdate,

    'anonymous',

    sysdate,

    'anonymous',

    NULL

  );





